  <title>Birthday Card</title>
  <link rel="stylesheet" href="./style.css">
  <style>
    body {
      width: 297mm;
      height: 210mm;
      margin: 0;
      padding: 0;
      display: flex;
      justify-content: center;
      align-items: center;
      background-color: #f0f0f0;
    }
    .card {
      width: 100%;
      height: auto;
      position: relative;
      display: flex;
      justify-content: center;
      align-items: center;
      background-color: white;
    }
    .card img {
      max-width: 100%;
      height: auto;
    }
    .students-profile {
      position: absolute;
      top: 20%;
      left: 24%;
      transform: translateX(-50%);
      display: flex;
      flex-direction: column;
      align-items: center;
    }
    .overlay-image {
      width: 130px;
      height: 150px !important;
      margin-bottom: 40px;
    }
    .name, .std, .birthdate {
      font-size: 20px;
      font-weight: bold;
      color: black; 
      text-align: center;
    }
    .std {
      position: absolute;
      top: 423px;
      left: 11%;
    }
    .birthdate {
      position: absolute;
      top: 423px;
      left: 31%;
    }
  </style>
